I think this method would be better for hashes:

The original is as follows:

``` python
@property
def sha1(self):
    return self._hash_lookup(Hash.TYPE_SHA1).value
```

However this causes issues when the has was not set, instead use something as follows

``` python
@property
def sha1(self):
    sha1_hash = self._hash_lookup(Hash.TYPE_SHA1)
    if hasattr(sha1_hash, 'value'):
       return sha1_hash.value
    else:
       return None
```

This is also valid for the remaining hashes.
